tables.table_schema:
CREATE TABLE assets (
    asset_id UUID PRIMARY KEY,
    asset_name STRING,
    asset_type STRING,
    asset_value DECIMAL
);

CREATE TABLE liabilities (
    liability_id UUID PRIMARY KEY,
    liability_name STRING,
    liability_type STRING,
    liability_amount DECIMAL
);

CREATE TABLE transactions (
    transaction_id UUID PRIMARY KEY,
    asset_id UUID,
    liability_id UUID,
    transaction_date TIMESTAMP,
    amount DECIMAL
);

CREATE TABLE savings (
    account_id INT PRIMARY KEY,
    account_name TEXT,
    bank_name TEXT,
    balance DECIMAL
);

CREATE TABLE AssetClasses (
    asset_class_id INT PRIMARY KEY,
    asset_class_name VARCHAR(50) NOT NULL
);

CREATE TABLE Stocks (
    stock_id INT PRIMARY KEY,
    stock_name VARCHAR(50) NOT NULL,
    stock_price DECIMAL(10, 2) NOT NULL
);

CREATE TABLE Bonds (
    bond_id INT PRIMARY KEY,
    bond_name VARCHAR(50) NOT NULL,
    bond_type VARCHAR(20)
);

CREATE TABLE MutualFunds (
    fund_id INT PRIMARY KEY,
    fund_name VARCHAR(50) NOT NULL,
    fund_type VARCHAR(20) NOT NULL
);

CREATE TABLE RealEstate (
    property_id INT PRIMARY KEY,
    property_name VARCHAR(50) NOT NULL,
    property_value DECIMAL(12, 2) NOT NULL
);
